import React from 'react';
import { TabContent, TabPane, Nav, NavItem, NavLink } from 'reactstrap';

function Home() {
  return (
    <div className="min-h-screen bg-csb-black">
      <div className="bg-csb-red">
        <Nav tabs fill>
          <NavItem>
            <NavLink
              active={this.state.active === 1}

            >
              Top Chart
            </NavLink>
          </NavItem>
          <NavItem>
            <NavLink
              active={this.state.active === 2}

            >
              Top Artist
            </NavLink>
          </NavItem>
        </Nav>
        <TabContent>
          <TabPane>Top Chart</TabPane>
          <TabPane>Top Artist</TabPane>
        </TabContent>
      </div>
    </div>
  );
}

export default Home;
